			"on_talk": "speech_dialog(self, [~Oh my, a visitor!~],
						   level.player, [~Hey, I'm sorry to barge in and all,
but what happened to that bridge?~],
						   self,         [~Yes, I've had a few people come in
to ask about that.~],
						                 [~There was a storm a few weeks ago,
and a big swell of water washed it out.~],
						                 [~You've probably seen this yourself, but
just to be sure... don't go into the water.~],
						                 [~Current that hard will just smash you
against the rocks.~],
						   level.player, [~Yeah... crap.  I'm actually a bit confused
about how to get where I'm going.~],
						                 [~See, I'm trying to make it to
Milgram's castle.~],
						   self,         [~Yes, he's quite the businessman.
It'd be nice if he could help us, here.~],
						   level.player, [~Hmm?~],
						   self,         [~Well, for one thing, it'd be nice if
anyone could help get this bridge fixed.~],
						                 [~I sent in a request shortly after it fell,
and they've been too busy to do anything.~],
						                 [~Anyways, the best way for you to go
would be to head to Tempo Village.~],
						                 [~There's a way from there to get to
Milgram's Castle.~],
						                 [~Now, unfortunately, the easiest way...~],
						                 [~...would have been to cross the
bridge next to this house.~],
						   level.player, [~Figures.~],
						   self,         [~Fortunately, you're not completely
out of luck.~],
						                 [~If you hike back a ways, you should
see a shortcut through the trees.~],
						                 [~Taking that will get you to an
odd contraption called \"the conveyance\".~],
						                 [~It's a ... little odd, but it is
a way across the river.~],
						   level.player, [~Yeah - sure beats \"nothing\", though.
Thanks a lot!~],
						   self,         [~No problem.  Best of luck.~])",
